import styled from "styled-components";

const FooterWrapper = styled.div`
    .footer {
        display: flex;
        align-items: center;
    }
  .add {
    background-color: #bdffcc;
    padding: 0;
    border-radius: 50%;
    position: fixed;
    height: 70px;
    width: 70px;
    display: flex;
    justify-content: center;
  }
`;

export default FooterWrapper;
